def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    keys = [key] if not isinstance(key, (list, tuple)) else key

    if isinstance(level, (list, tuple)):
        levels = level
    else:
        levels = [level] * len(keys)

    groupings = []
    exclusions = []

    for i, (gpr, level) in enumerate(zip(keys, levels)):
        if isinstance(gpr, Grouper):
            binner, grouper, obj = gpr._get_grouper(obj, validate=False)
            if gpr.key is None:
                return grouper, [], obj
            else:
                return grouper, {gpr.key}, obj
        elif isinstance(gpr, BaseGrouper):
            return gpr, [], obj
        else:
            in_axis, name = True, gpr
            if name not in obj:
                raise KeyError(name)
            else:
                if validate:
                    obj._check_label_or_level_ambiguity(gpr)
                gpr = obj[gpr]
                exclusions.append(name)

        groupings.append(Grouping(
            group_axis,
            gpr,
            obj=obj,
            name=name,
            level=level,
            sort=sort,
            observed=observed,
            in_axis=in_axis,
        ))

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")
    elif len(groupings) == 0:
        groupings.append(Grouping(
            Index([], dtype="int"),
            np.array([], dtype=np.intp)
        ))

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
